import React from "react";
import MapAPI from "./MapAPI";
import styled from "styled-components";

const MapContainer = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
`;

const ContactContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 500px;
`;

const ContactForm = styled.form`
  width: 284px;
  height: 300px;
  background: white;
  padding: 1rem;
  border-radius: 6px;
`;

const Map = () => {
  return (
    <MapContainer>
      <MapAPI />
      <ContactContainer>
        <ContactForm>
          <h3>이름</h3>
          <input type="text" />
        </ContactForm>
      </ContactContainer>
    </MapContainer>
  );
};

export default Map;
